	var getPositionPow = function getPositionPow(bird, shoot) {
		// show shoot
		shoot.show(true);
		bird.show(false);
		
		//get position of bird
		var computedStyle = getComputedStyle(bird.dom, null);
		var posLeft = parseFloat(computedStyle.left) + parseFloat(computedStyle.width) * 0.5;
		var posTop = parseFloat(computedStyle.top) + parseFloat(computedStyle.height) * 0.5;
		//get transform
		var translate = getElementTranslation(bird);
		posLeft += translate.x;
		posTop += translate.y;
		var powComputedStyle = getComputedStyle(shoot.dom, null);
		
		shoot.setPosition(posLeft - parseFloat(powComputedStyle.width) * 0.5, 
			posTop - parseFloat(powComputedStyle.height) * 0.5 );
			
	};
	f.push([2, "getPositionPow", getPositionPow]);
